import { ContainerNavBar, ContainerNav } from "./styles";
import React from 'react'
import { useFormik } from 'formik';
import { useGetSearch } from "../../Contexts/SearchContext";
import { githubProvider } from "../../config/authMethods";
import socialMediaAuth from "../../services/auth";


const NavBar = () => {  
    const {search, setSearch} = useGetSearch();
    // Pass the useFormik() hook initial form values and a submit function that will

    // be called when the form is submitted

    const formik = useFormik({

      initialValues: {

        name: '',

      },

      onSubmit: values => {

        setSearch(values)

      },

    });

    const handleOnClick = async (provider) => {
      const res = await socialMediaAuth(provider)
      setSearch(res)
    }

  return (
  <>
    <ContainerNavBar>
      <ContainerNav>
          <nav>
            <img src="data:image/svg+xml;base64," ></img>
            <ul>
              <li>Why github?</li>
              <li>Team</li>
              <li>Enterprise</li>
              <li>Explore</li>
              <li>Marketplace</li>
              <li>Pricing</li>
            </ul>


          </nav>

          <form onSubmit={formik.handleSubmit}>

            <input

              id="name"

              name="name"

              type="text"

              onChange={formik.handleChange}

              value={formik.values.name}

            />

            <button type="submit">Submit</button>
            <button type="button" onClick={() => handleOnClick(githubProvider)}>Sign in</button>

          </form>

          {/* <form action="/login">
          <input type="text" onChange={handleChange} placeholder="Search" />
            <button type="submit">Sign In</button>
            <button>Sign Up</button>

          </form> */}
      </ContainerNav>
    </ContainerNavBar>
  </>
  )
}

export default NavBar
